import React, { Component } from 'react';
import ScatterJS from 'scatterjs-core';
import ScatterEOS from 'scatterjs-plugin-eosjs';
import './App.css';
import Unity, { UnityContent } from "react-unity-webgl";

ScatterJS.plugins( new ScatterEOS() );
const network = {
    blockchain:'eos',
    protocol:'https',
    host:'jungle2.cryptolions.io',
    port:443,
    chainId:'e70aaab8997e1dfce58fbfac80cbbb8fecec7b99cf982a9444273cbc64c41473'
}

class App extends React.Component {

    constructor(props){
        super(props);

        this.unityContent = new UnityContent(
          "http://192.168.219.104:3000/Build/ydw.json",
          "http://192.168.219.104:3000/Build/UnityLoader.js"
        ); 

        this.unityContent.on("GameOver", score => {
            console.log(score);
        });
    }

    render() {
        return <Unity unityContent={this.unityContent} style="width: 1600px; height: 900px; margin: auto"/>;
    }
}

export default App;
